Let
\[f(x) = x^2 \cos \theta - x(1 - x) + (1 - x)^2 \sin \theta.\]Then $f(0) = 0$ and $f(1) = 0.$  By writing
\[f(x) = 2x(1 - x) \cos \theta + (1 - x)^2 (\sin \theta - 1),\]we see that $f(x)$ achieves its maximum at $x = \frac{1}{2}.$  Hence,
\[f \left( \frac{1}{2} \right) = \frac{\cos \theta}{4} + \frac{\sin \theta - 1}{4} \ge 0.\]This gives us
\[\cos \theta + \sin \theta - 1 \ge 0.\]This eventually simplifies to
\[\sin \theta + \cos \theta \ge \frac{1}{\sqrt{2}}.\]The solutions to $\sin \theta + \cos \theta = \frac{1}{\sqrt{2}}$ are the solutions to
\[\sqrt{2} \sin \left( \theta + \frac{\pi}{4} \right) = \frac{1}{\sqrt{2}},\]or
\[\sin \left( \theta + \frac{\pi}{4} \right) = \frac{1}{2}.\]Thus, the solutions are of the form
\[\theta + \frac{\pi}{4} = \frac{\pi}{6} + 2k \pi, \frac{5 \pi}{6} + 2k \pi\]for integers $k.$  This tells us
\[\theta = -\frac{\pi}{12} + 2k \pi, \frac{7 \pi}{12} + 2k \pi.\]For $0 \le \theta \le 2 \pi,$ these become
\[\theta = \frac{\pi}{12}, \frac{7 \pi}{12}, \frac{13 \pi}{12}, \frac{19 \pi}{12}.\]Alternatively, we can go for an elegant solution from Che叫 SS who pointed out that we may plot the the functions $y = \sin \theta$ and $y = -\cos \theta$, with their periods from $0$ to $2\pi$. A look at the graphs shows that on $(0, 2\pi)$, the graph of $y = \sin \theta$ is above the line $y = -\cos \theta$ at $\theta = \frac{\pi}{12}, \frac{7 \pi}{12}, \frac{13 \pi}{12}, \frac{19 \pi}{12}.$

