filldraw(box((-0.2, -1.2), (2*pi + 0.2, 1.2)), rgb(0.9,0.9,0.9));
draw((0,0)--snip(plots[0],0,0,-1)--(-1,0)--cycle, linewidth(1));
trig_grid(-0.2*pi, 2*pi + 0.2*pi, 0, 1.5);
label("$\frac{\pi}{12}$", (pi/12, 0), S, fontsize(10));
label("$\frac{7\pi}{12}$", (7*pi/12, 0), S, fontsize(10));
