label("$\frac{19\pi}{12}$", (19*pi/12, 0), S, fontsize(10));[/asy]Hence the solutions are
\[\theta = \frac{\pi}{12}, \frac{7 \pi}{12}, \frac{13 \pi}{12}, \frac{19 \pi}{12}.\]Indeed we can prove that for $\theta\ne \frac{5\pi}{12}, \frac{7\pi}{12}, \frac{11\pi}{12}, \frac{13\pi}{12}$, function $y=x^2 \cos\theta - x(1 - x) + (1 - x)^2 \sin\theta$ is either always greater or always smaller than 0 when $0\le x\le 1$. At $\theta= \frac{5\pi}{12}, \frac{7\pi}{12}, \frac{11\pi}{12}, \frac{13\pi}{12}$, function equals to 0 at $x=0, 1, \frac{1}{2}$. Hence the values of $\theta$ for which $x^2\cos\theta - x(1 - x) + (1 - x)^2\sin\theta > 0$ hold for all $0\le x\le 1$ are $$\theta \in \left\{ \frac{\pi}{12}, \frac{7\pi}{12}, \frac{13\pi}{12}, \frac{19\pi}{12} \right\}$$ So the general solution is a combination of above, that is
\[\theta = \frac{12n + 1}{12}\pi, \ \ n \in Z\]. When $0 \le \theta\le 2 \pi$, possible values of $n = 0, \pm1, \pm2$. which makes the possible values for $\theta $
\[\theta = \frac{1}{12}\pi , \frac{5}{12}\pi , \frac{7}{12}\pi , \frac{11}{12}\pi , \frac{13}{12}\pi , \frac{17}{12}\pi ,\]or in $[0,2\pi]$-interval\[\theta = \frac{\pi}{12}, \frac{5\pi}{12}, \frac{7\pi}{12}, \frac{11\pi}{12}, \frac{13\pi}{12}, \frac{17\pi}{12}.\]Hence from the 6 values only
\[\theta = \frac{\pi}{12}, \frac{7 \pi}{12}, \frac{13 \pi}{12}, \frac{19 \pi}{12}\]solving the inequality. The answer is: $\frac{\pi}{12}$ and $\frac{7 \pi}{12}, \frac{13 \pi}{12}, \frac{19 \pi}{12}$. Thus \[{\theta = \frac{ \pi}{12}, \frac{7 \pi}{12}, \frac{13 \pi}{12}, \frac{19 \pi}{12}}\]solves the inequality. The answer is: $\frac{\pi}{12}$,$\frac{7 \pi}{12}$,$\frac{13 \pi}{12}$,$\frac{19 \pi}{12}$

